Tijdens het eerste deel zijn het vooral Sasha Rosen, Davy Gilles, Anne Mie Gils en Peter Thyssen die het sprookjesverhaal langzaam uitvouwen. De vonken springen over tussen prins- en prinses Davy Gilles en Sasha Rosen die in het echt ook verliefd zijn op elkaar. Het verhaal komt echt op gang als vlak voor de pauze de zeven dwergen komen opdraven om het publiek met kloppend hart van de pauze te laten genieten. Het tweede deel van de musical is werkelijk geweldig. De dwergen staan vaker op het podium wat echt speciale momenten zijn in de muscial. Waar iedereen natuurlijk naar uitkijkt is het moment waarop de prins Sneeuwwitje wakker kust.
